import React from 'react';
import "./Inicio.css";
import Menu from "../../Menu";
import Header from '../../Header';
import Calendar from '../../Calendar';
import "../../Fonts.css";
// ...código anterior omitido para concisão

const Inicio = () => {
  const colorCode = 0; // O valor de colorCode será alterado conforme situação da consulta (0 / verde = confirmada, 1 / cinza = pendente e 2 / rosa = cancelada)

  return (
    <div className="container">
      <div className="item item1-1"><Menu /></div>
      <div className="item item1-2"><Header/></div>
      <div className="item item2" style={{ width: "97.5%", gridColumn: "2 / 3"}}>
        <Calendar colorCode={colorCode} />
      </div>
      <div className="item item3"> 
        <button className="circle-button">+</button>
      </div>
    </div>
  );
};

export default Inicio;
